import Cities from './Cities-container'
import { connect } from 'react-redux'

const mapStateToProps = state => {
    console.log(state)
    return {
        citiesList: state.data.cities.city + ' ,' + state.data.cities.country
    }
}

export default connect(mapStateToProps)(Cities)
